import Dropdown from "react-bootstrap/Dropdown";
import styles from "./DropdownHome.module.css";
function DropdownHome() {
  return (
    <>
      <Dropdown>
        <Dropdown.Toggle style={{ background: "transparent", border: "none" }}>
          <span className={styles.bar}></span>
          <span className={styles.bar}></span>
          <span className={styles.bar}></span>
        </Dropdown.Toggle>

        <Dropdown.Menu className={styles.menu}>
          <Dropdown.Item active>Merch</Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item>Hubs</Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item>Episodes</Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item>Contact</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    </>
  );
}

export default DropdownHome;
